import React, { useContext } from 'react';
import UserContext from './userContext';
import { useHistory } from 'react-router-dom'

const Logout = () => {
  let { tokenFromSignUp, tokenFromLogin } = useContext(UserContext);
  if (tokenFromSignUp) tokenFromSignUp = '';
  if (tokenFromLogin) tokenFromLogin = '';

  return <Redirect to="/" />
};

export default Logout;
